import React from "react";
import { StyleSheet, View, Image } from "react-native";

import { AppText as Text } from "../";

export default () => <View style={styles.view}></View>;

const styles = StyleSheet.create({
  view: {
    backgroundColor: "white",
    width: "100%",
    paddingLeft: "25px",
    paddingRight: "25px",
    paddingTop: "15px",
    paddingBottom: "15px",
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-around",
    position: "fixed",
    bottom: "0",
    left: "0",
    shadowOffset: { width: "4px", height: "4px" },
    shadowColor: "rgba(0, 0, 0, 0.17)",
    shadowOpacity: 1.0
  },
  item: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center"
  }
});
